km(3,"Permanent crop & watercress copying","You unlocked your first permanent type of plant. Plants like this stay on the field forever, keep producing forever, and have much more powerful production upgrades too.<br><br>If you plant watercress next to permanent plants, the watercress copy all its neighbors (orthogonal, not diagonal) production for free. If there is more than 1 watercress in the entire field this gives diminishing returns, so having 1 or perhaps 2 max makes sense (by design: no need to replant many watercress all the time. Check the seeds/s income to experiment). The watercress is its own independent multiplier so it works well and is relevant no matter how high level other boosts the permanent plant has later in the game.<br><br>TIP: hold SHIFT to plant last crop type, CTRL to plant watercress",void 0,
"<br><br>The image below shows an optimal configuration to use for watercress copying: the single watercress duplicates the production of 4 blackberries:",[[void 0,ub[4],void 0],[ub[4],Nb[4],ub[4]],[void 0,ub[4],void 0]]);
km(19,"Mushrooms","You unlocked your first type of mushroom. Mushrooms produce spores, but they consume seeds. Mushrooms must touch berries to get their seeds. If the berry cannot produce enough seeds for the mushroom, the mushroom produces less spores. If the berry produces more seeds than needed, the remaining seeds go to the regular seeds stack<br><br>Spores let the tree level up, unlocking next kinds of bonuses.<br><br>Spores are used by the tree, but the mushroom is not required to touch the tree.",void 0,
"<br><br>The image shows a possible configuration for mushrooms: it extracts some seeds from the berries it touches.",[[Ib[4],vb[4]],[vb[4],void 0]]);
