km(2,"Tree dropped fruit",'The tree reached level 5 and dropped a fruit! Fruits provide boosts and can be upgraded with fruit essence. Essence is gained by sacrificing fruits, and all full amount of fruit essence can be used for upgrading all other fruits at the same time. See the "fruit" tab, it also has a more extensive help dialog for fruits.<br><br>A possible strategy: keep fruits with good abilities you like. Sacrifice any other surpluss fruits, so you can use the essence to upgrade the good fruits.',qb[0]);
km(18,"Tree dropped better fruit","The tree reached level 15 and dropped another fruit! Fruits from higher tree levels have random probability to be of better, higher tier, types.",qb[2]);km(7,"Tree can transcend","The tree reached adulthood, and is now able to transcend! Click the tree in the field to view the transcension dialog.",void 0,void 0,[[void 0,Xb[Nh(10)][1][0]],[void 0,Xb[Nh(10)][2][0]]]);
